import React from 'react'
import { useSelector } from 'react-redux'

const ViewTodo = () => {
  const todos = useSelector((state) => state.todos.name)
  console.log(todos)
  return (
    <div>
      {
        todos.map((todo) =>(
          <li>{todo}</li>
        ))
      }
      </div>
  )
}

export default ViewTodo
